	add("firebrand", "{\"term\":\"firebrand\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027fyrebrand\u0027 \u0027furbrond\u0027 equivalent to {{compound|fire|brand|lang\u003den}}. Cognate with German \u0027feuerbrand\u0027 (firebrand)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An argumentative troublemaker or revolutionary; one who agitates against the current situation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The member of the college\u0027s Communist League was a \u0027\u0027firebrand\u0027\u0027 who would launch a sit-in or protest march at a moment\u0027s notice\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003dIn the Ferguson era, Malcolm X‚Äôs courage in fighting racism inspires more than work\u003d date\u003d20 February url\u003dhttp://www.theguardian.com/commentisfree/2015/feb/20/ferguson-malcolm-x-racism-assassination-martin-luther-king-ferguson|passage\u003dBoth Malcolm and King were \u0027\u0027firebrands\u0027\u0027. And both were disciplined organisers of people. Malcolm was able to channel the anger of a crowd into action, but then to ensure they did not descend into violence\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A torch or other burning stick with a flame at one end\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The crowd cheered as a \u0027\u0027firebrand\u0027\u0027 was tossed on the huge pile of wood to start the traditional homecoming bonfire\", \"priority\":5}]}, \"synonyms\":{}}");

