	add("firkin", "{\"term\":\"firkin\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"middle dutch (ca. 1050-1350)\", \"English\"], \"text\":\"From Middle dutch (ca. 1050-1350) {{m|dum|*vierdekijn}}, diminutive of \u0027vierde\u0027 (fourth) \u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt; from \u0027vier\u0027 (four) equivalent to {{suffix|fourth|kin|lang\u003den|nocat\u003d1}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A varying measure of capacity, usually being the fourth part of a barrel; specifically, a measure equal to nine imperial gallons. [Eng\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1882\u0027\u0027, James Edwin Thorold Rogers, \u0027A History of Agriculture and Prices in England\u0027, Volume 4, p. 205\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"23 Hen. VIII, cap. 4... The barrel of beer is to hold 36 gallons, the kilderkin 18 gallons the firkin 9. But the barrel, kilderkin, and firkin of ale are to contain 32, 16, and 8 gallons\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A small wooden vessel or cask of indeterminate size, -- used for butter, lard, etc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A weight measure for butter, equalling 56 pounds\", \"priority\":5}]}, \"synonyms\":{}}");

	add("firman", "{\"term\":\"firman\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Persian\", \"Turkish\"], \"text\":\"From Turkish \u0027ferman\u0027 from Persian {{m|fa|ŸÅÿ±ŸÖÿßŸÜ|tr\u003dfarm√¢n|gloss\u003dcommand, order, decree}}.\u0026lt;ref\u0026gt;[http://dictionary.reference.com/browse/firman \u0026quot;firman.\u0026quot;] Dictionary.com. \u0027Dictionary.com Unabridged (v 1.1).\u0027 Random House, Inc. 2008.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A royal decree issued by a sovereign in certain historical Islamic states, especially by the Sultan of Turkey\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1819\u0027\u0027, \u0027Don Juan\u0027, IV\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"his Sublimity\u0027s \u0027\u0027firman\u0027\u0027, The most imperative of sovereign spells, / Which every body does without who can\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, \u0027The Great Game\u0027, Folio Society 2010, p. 134\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He managed to obtain from the vizier a \u0027\u0027firman\u0027\u0027 bearing the Emir\u0027s personal seal and ordering all Bokharan officials to assist the party in every way possible\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027: \u0027International Law And The Great War\u0027, Coleman Phillipso\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"It will be noted that the title of Sultan was adopted partly because that of Khedive had been conferred by an Ottoman \u0027\u0027firman\", \"priority\":7}]}, \"synonyms\":{}}");

