	add("firstfruits", "{\"term\":\"firstfruits\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Offering of the first of the harvest\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"And now, behold, I have brought the \u0027\u0027firstfruits\u0027\u0027 of the land, which thou, O LORD, hast given me. And thou shalt set it before the LORD thy God, and worship before the LORD thy God: And thou shalt rejoice in every good thing which the LORD thy God hath given unto thee, and unto thine house, thou, and the Levite, and the stranger that is among you\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1854\u0027\u0027, Samuel Knaggs - Unsoundness of Mind Considered in Relation to the Question of Responsibility for Criminal Act\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Most authors, I imagine, regard the introduction of the \u0027\u0027firstfruits\u0027\u0027 of their pen to public notice with feelings akin to timidity\", \"priority\":4}]}, \"synonyms\":{}}");

